using System;
using System.Collections.Generic;
using SkiaSharp;

namespace Palantir
{
    public static class SpriteComboImage
    {
        public static string GenerateImage(string[] spriteSources, string savePath)
        {
            savePath = savePath + DateTimeOffset.Now.ToUnixTimeMilliseconds().ToString() + ".png";
            string svgst = @"<svg xmlns=""http://www.w3.org/2000/svg"" xmlns:xlink=""http://www.w3.org/1999/xlink"" viewBox = ""0 0 80 80"" >";
            foreach (string sprite in spriteSources)
            {
                byte[] imageArray = System.IO.File.ReadAllBytes(sprite);
                string base64ImageRepresentation = Convert.ToBase64String(imageArray);
                svgst += @"<image width=""80"" height=""80"" xlink:href=""data:image/gif;base64," + base64ImageRepresentation + @"""/>";
            }
            svgst += "</svg>";

            var svg = new SKSvg(new SKSize(80, 80));
            System.IO.Stream svgstream = new System.IO.MemoryStream(System.Text.Encoding.ASCII.GetBytes(svgst));
            svg.Load(svgstream);
            var bitmap = new SKBitmap((int)svg.CanvasSize.Width, (int)svg.CanvasSize.Height);
            var canvas = new SKCanvas(bitmap);
            canvas.DrawPicture(svg.Picture);
            
            canvas.Flush();
            canvas.Save();
            using (var image = SKImage.FromBitmap(bitmap))
            using (var data = image.Encode(SKEncodedImageFormat.Png, 80))
            {
                // save the data to a stream
                using (var stream = System.IO.File.OpenWrite(savePath))
                {
                    data.SaveTo(stream);
                }
            }
            return savePath;
        }

        public static void FillPlaceholders(ref string svg, string profilebase64, string spritebase64, string color, string username, string bubbles, string drops, double dropratio, string firstseen, 
            string sprites, string events, string hours, string brank, string drank, string servers, bool patron, bool early, bool moderator)
        {
            string font = @"@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0460-052F,U+1C80-1C88,U+20B4,U+2DE0-2DFF,U+A640-A69F,U+FE2E-FE2F}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0400-045F,U+0490-0491,U+04B0-04B1,U+2116}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+1F00-1FFF}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0370-03FF}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0102-0103,U+0110-0111,U+0128-0129,U+0168-0169,U+01A0-01A1,U+01AF-01B0,U+1EA0-1EF9,U+20AB}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0100-024F,U+0259,U+1E00-1EFF,U+2020,U+20A0-20AB,U+20AD-20CF,U+2113,U+2C60-2C7F,U+A720-A7FF}@font-face{font-family:Roboto;font-style:normal;font-weight:400;font-display:swap;src:url(data:font/woff2;base64,) format('woff2');unicode-range:U+0000-00FF,U+0131,U+0152-0153,U+02BB-02BC,U+02C6,U+02DA,U+02DC,U+2000-206F,U+2074,U+20AC,U+2122,U+2191,U+2193,U+2212,U+2215,U+FEFF,U+FFFD}";
            color = "#header,#border{stroke:" + color + "} #header{fill:" + color + "} *{font-style:'Roboto' !important} ";
            string greyout = (patron ? "" : " #patron * {opacity: .5} ")
                + (early ? "" : " #early * {opacity: .5} ")
                + (moderator ? "" : " #moderator * {opacity: .5} ");
            if (username.Length > 15) username = username.Substring(0, 12) + "..";
            string rationame = (dropratio < 0.5 ? "Newbie" : dropratio < 2 ? "Relaxed" : dropratio < 3 ? "Ambitious" : dropratio < 5 ? "Capable" : dropratio < 8 ? "Skilled" : dropratio < 10 ? "Expert" : dropratio < 12 ? "Epic!" : "Godmode");
            svg = svg.Replace("$username$", username)
                .Replace("$bubbles$", bubbles + " Bubbles")
                .Replace("$drops$", drops + " Drops")
                .Replace("$dropratio$", " " + dropratio + " (" + rationame + ")")
                .Replace("$firstseen$", firstseen)
                .Replace("$sprites$", " " + sprites + " bought")
                .Replace("$events$", events)
                .Replace("$hours$", " " + hours)
                .Replace("$brank$", " #" + brank)
                .Replace("$drank$", " #" + drank)
                .Replace("$servers$", servers)
                .Replace("$profilebase64$", profilebase64)
                .Replace("$spritebase64$", spritebase64)
                .Replace("$customstyle$", font + color + greyout);
        }

        public static string SVGtoPNG(string svgst, string savePath)
        {
            savePath = savePath + DateTimeOffset.Now.ToUnixTimeMilliseconds().ToString();
            System.IO.File.WriteAllText(savePath + ".svg", svgst);
            string command = "sudo inkscape --export-dpi=200 -z " + savePath + ".svg -e " + savePath + ".png";
            command.Bash();
            System.IO.File.Delete(savePath + ".svg");
            return savePath + ".png";
        }

        public static string[] GetSpriteSources(int[] sprites)
        {
            List<string> sources = new List<string>();
            foreach (int id in sprites)
            {
                Sprite spt;
                try
                {
                    spt = BubbleWallet.GetSpriteByID(id);
                }
                catch { continue; }
                if (spt.URL.Contains("https://tobeh.host/"))
                {
                    sources.Add(spt.URL.Replace("https://tobeh.host/", "/home/pi/Webroot/"));
                }
                else
                {
                    // download sprite
                    System.Net.WebClient client = new System.Net.WebClient();
                    string path = "/home/pi/Webroot/files/combos/" + DateTimeOffset.Now.ToUnixTimeMilliseconds().ToString() + ".gif";
                    client.DownloadFile(spt.URL,path);
                    sources.Add(path);
                }
            }
            return sources.ToArray();
        }
    }
}
